import React from "react";
import {
    Modal,
    ModalOverlay,
    ModalContent,
    ModalHeader,
    ModalFooter,
    ModalBody,
    ModalCloseButton,
    useDisclosure,
  } from "@chakra-ui/react";

export const MeditateModal = () => {
    const { isOpen, onOpen, onClose } = useDisclosure()
  return (
    <div>
      <Center>
        <Button onClick={onOpen}>Meditate</Button>
      </Center>
      <Modal
        isOpen={isOpen}
        onClose={onClose}
        motionPreset="slideInBottom"
        size={"xl"}
      >
        <ModalOverlay />
        <ModalContent>
          <ModalHeader>Follow Medidation Tutorials</ModalHeader>
          <ModalCloseButton />
          <ModalBody>
            <audio
              src="https://assets.calm.com/1f2a60e567945384b84a7aa3c6949b42.m4a"
              title="The Present"
            ></audio>
          </ModalBody>
          <ModalFooter>
            <Button colorScheme="blue" mr={3} onClick={onClose}>
              Close
            </Button>
          </ModalFooter>
        </ModalContent>
      </Modal>
    </div>
  );
};
